import Card from '../Card'
import uwLogo from '../../resources/color-UWcrest-print.png'
import mePhoto from '../../resources/me.jpg'


export default class TopBarNav extends React.Component{
    constructor(props){
        super(props)
        this.state={

        }
    }

    render(){
        return(
            <div style={{height: 40, width: '100%', flexDirection: 'row', display: 'flex'}}>

                {/* My name and wisconsin Image */}
                <Card clickable={false} height='100%' width='40vw' style={{flex: 1}}>
                <img src={uwLogo} style={{ maxHeight: '100%', width: 20 }}></img>
                    <text style={{ fontFamily: 'Helvetica', fontSize: 50, paddingLeft: 20 }}>
                        Max Johnson
                </text>
                </Card>

                {/* Home Button */}
                <Card clickable={true} height='100%' width= '15vw'>
                    <text>
                        Home
                    </text>
                </Card>

                {/* Projects Button */}
                <Card clickable={true} height='100%' width= '15vw'>
                    <text>
                        Projects
                    </text>
                </Card>

                {/* Gallery Button */}
                <Card clickable={true} height='100%' width= '15vw'>
                    <text>
                        Gallery
                    </text>
                </Card>

                {/** Contact Button */}
                <Card clickable={true} height='100%' width= '15vw'>
                    <text>
                        Contact
                    </text>
                </Card>
            </div>
        )
    }
}
